import React from "react";


export default function Mission() {

    const missionVid = 'https://www.w3schools.com/html/mov_bbb.mp4';

    return(
        <div className="mission-sect">      
        <h4>HOME PAGE MISSION SECTION</h4>
            <div className="mission-vid">
                <video width="100%" height="100%" controls autoplay muted>
                    <source src={missionVid} type="video/mp4" />
                </video>
            <p className="mt-1">Mission Video w/ control & description overlay</p>
            </div>
            <div className="container mission-stats">
            <span>Statistics and why GYS</span>
            </div>
        </div>

    )
}
